import React from 'react';

class Input extends React.Component {
	constructor(props) {
		super(props);
		this.input = React.createRef();
	}


	render() {
		return (
			<div>
				<form className="ui form">
					<div className="field">
						<input type="text" ref={this.input} />
					</div>
				</form>
			</div>
		);
	}
}

export default Input;
